// src/Sidebar.js
import React from 'react';

const Sidebar = ({ onSelect }) => {
    return (
        <div className="sidebar">
            <h2>Menu</h2>
            <a href="#" onClick={() => onSelect('user')}>User</a>
            <a href="#" onClick={() => onSelect('menu')}>Menu</a>
            <a href="#" onClick={() => onSelect('order')}>Order</a>
            <a href="#" onClick={() => onSelect('payment')}>Payment</a>
        </div>
    );
};

export default Sidebar;
